/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */

/**
 * An enumeration.
 */
export enum JobStatusType {
    SUBMITTED = 'submitted',
    RUNNING = 'running',
    DONE = 'done',
    FAILED = 'failed',
    CANCELED = 'canceled',
}
